import { useState } from "react";
import "./../UI/Todo.css";
import TodoResults from "./TodoResults";
const TodoList = (props) => {
  const [Datalen, setDataLen] = useState()
  
  return (
    <ul className="UserResults">
      {props.Data.length === 0 ? (
        <TodoResults
          value={"There are Nothing Here"}
          keys={"arsa"}
          DataLen={props.Data.length}
        />
      ) : (
        props.Data.map((el) => {
          return (
            <TodoResults
              value={el.value}
              DataLen={props.Data.length}
              state={el.state}
              keys={el.keys}
              checkState={props.onCheckState}
            />
          );
        })
      )}
      <div className="active-states">
        <p>{props.Data.length} items left</p>
        <div className="check-btns">
          <button>All</button>
          <button>Active</button>
          <button>Completed</button>
        </div>
        <button>Clear Completed</button>
      </div>
    </ul>
  );
};
export default TodoList;
